import React, { Component } from 'react'
import { Row, Col, Button } from 'antd';
import { connect } from 'react-redux';
import { loadTranscation } from '../../../Store/Action/transcation'
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';

export class Transcation extends Component {
    componentDidMount(){
        this.props.loadTranscation()
    }
    createData(name, calories, fat, carbs, protein) {
        return { name, calories, fat, carbs, protein };
      }

    render() {

      const rows = [
        this.createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
        this.createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
        this.createData('Eclair', 262, 16.0, 24, 6.0),
        this.createData('Cupcake', 305, 3.7, 67, 4.3),
      ];

        return (
          <div className="container-fluid">
            <Row>
                <Col span={12}>
                    {/* BreadCrumps */}
                    <div className="row">
                        <div className="col-lg-6">
                            <div className="page-title-box">
                                <div className="row">
                                    <div className="col">
                                        <h4 className="page-title">Transcations</h4>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </Col>
                <Col span={12}>
                    <Button type="primary" style={{ float: 'right', marginRight: '100px' }}>Add a Transcation</Button>
                </Col>
            </Row>
            <div style={{ padding: '50px' }}>
                <TableContainer>
                    <Table  aria-label="simple table">
                        <TableHead style={{ backgroundColor: 'blue' }}>
                            <TableRow>
                                <TableCell>Dessert (100g serving)</TableCell>
                                <TableCell align="right">Calories</TableCell>
                                <TableCell align="right">Fat&nbsp;(g)</TableCell>
                                <TableCell align="right">Carbs&nbsp;(g)</TableCell>
                                <TableCell align="right">Protein&nbsp;(g)</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody >
                        {rows.map((row) => (
                            <TableRow key={row.name}>
                            <TableCell component="th" scope="row">
                                {row.name}
                            </TableCell>
                            <TableCell align="right">{row.calories}</TableCell>
                            <TableCell align="right">{row.fat}</TableCell>
                            <TableCell align="right">{row.carbs}</TableCell>
                            <TableCell align="right">{row.protein}</TableCell>
                            </TableRow>
                        ))}
                        </TableBody>
                    </Table>
                </TableContainer>
            </div>
          </div>
        )
    }

}

const mapStateToProps = (state) => ({
    isLoading: state.auth.isLoading,
    transcation: state.transcation,
  });


export default connect(mapStateToProps,{loadTranscation})(Transcation);
